import React, { Component } from 'react';

export default class Posts extends Component {

  showPosts = () => {
    return this.props.posts.map(function (post) {
      return <Post post={post}/>
    })
  }

  render() {

    return (
      <ul>
        {this.showPosts()}
      </ul>
    );
  }
}
